8ABADA7caNG6VDD62t3NzfNHnyFKdXBwAAAAAAAAAAAAAAwBDLpwAGAAAAAAAAAAAAAAAAAADmy3J6BQAAAAAAAAAAAAAAAAAAQOpIAAQAAAAAAAAAAAAAAAAAwINIAAQAAAAAAAAAAAAAAAAAwINIAAQAAAAAAAAAAAAAAAAAwIMqSiGn1wEAAAAAAAAA4EFlry6HHVoPAAAAAACAoKro9AoAAAAAAAAAALwlVOa/pZ8PkwgIAAAAAABgGxIAAQAAAAAAAACGhWIk/pX9vUgCBAAAAAAAsEWW0ysAAAAAAAAAAAAAAAAAAABSRwIgAAAAAAAAAMCQRJX/yr7O6GsBAAAAAACQPqYABgAAAAAAAAAYEt6f2Mf0vgAAAAAAAO5ABUAAAAAAAAAAgCFU9QMAAAAAAHAXEgABAAAAAAAAAIZQ+Q8AAAAAAMBdSAAEAAAAAAAAABhmJAkwTLIgAAAAAACALUgABAAAAAAAAACkhOQ+AAAAAAAAdyABEAAAAAAAAACQsnhJgCQHAgAAAAAA2Kei0ysAAAAAAAAAAPAmkv0AAAAAAACc9f8BiFr/V8cyfZEAAAAASUVORK5CYII=", caption: "A IA começa a gerar variações criativas do seu post." }];
    let current = 0;
    let autoInterval = null;

    const img = document.getElementById('slideImg');
    const caption = document.getElementById('slideCaption');
    const counter = document.getElementById('counter');
    const prevBtn = document.getElementById('prevBtn');
    const nextBtn = document.getElementById('nextBtn');
    const autoBtn = document.getElementById('autoBtn');
    const progressBar = document.getElementById('progressBar');

    function show(index) {
      current = Math.max(0, Math.min(index, slides.length - 1));
      img.src = slides[current].src;
      caption.textContent = slides[current].caption;
      counter.textContent = `${current + 1} / ${slides.length}`;
      prevBtn.disabled = current === 0;
      nextBtn.disabled = current === slides.length - 1;
      progressBar.style.width = `${((current + 1) / slides.length) * 100}%`;
    }

    prevBtn.addEventListener('click', () => show(current - 1));
    nextBtn.addEventListener('click', () => show(current + 1));

    autoBtn.addEventListener('click', () => {
      if (autoInterval) {
        clearInterval(autoInterval);
        autoInterval = null;
        autoBtn.textContent = '▶ Auto';
        autoBtn.classList.remove('active');
      } else {
        autoInterval = setInterval(() => {
          if (current < slides.length - 1) show(current + 1);
          else { clearInterval(autoInterval); autoInterval = null; autoBtn.textContent = '▶ Auto'; autoBtn.classList.remove('active'); }
        }, 1800);
        autoBtn.textContent = '⏸ Pausar';
        autoBtn.classList.add('active');
      }
    });

    show(0);
  </script>
